def CN3x(io8g, deep=0):
    # print(deep)
    # if deep == 0:
    #     print(io8g, deep)
    if io8g < -128:
        return CN3x(128 - (-128 - io8g), deep + 1)
    elif io8g >= -128 and io8g <= 127:
        return io8g
    elif io8g > 127:
        return CN3x(-129 + io8g - 127, deep + 1)
    else:
        print('error')


